itle=\"\u0421\u0435\u043d\u0435\u0433\u0430\u043b\">\u0421\u0435\u043d\u0435\u0433\u0430\u043b<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D1%83%D0%B7%D1%81%D0%BA%D0%B8%D0%B9_%D0%A1%D1%83%D0%B4%D0%B0%D0%BD\" title=\"\u0424\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0439 \u0421\u0443\u0434\u0430\u043d\">\u0424\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0439 \u0421\u0443\u0434\u0430\u043d<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b\u0438 \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435 \u043e \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F_%D0%9C%D0%B0%D0%BB%D0%B8\" title=\"\u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u044f \u041c\u0430\u043b\u0438\">\u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438 \u041c\u0430\u043b\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1966_%D0%B3%D0%BE%D0%B4\" title=\"1966 \u0433\u043e\u0434\">1966<\/a>&#160;\u2014 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0441\u0442\u0440\u0430\u0442\u0435\u0433\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0431\u043e\u043c\u0431\u0430\u0440\u0434\u0438\u0440\u043e\u0432\u0449\u0438\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Boeing_B-52_Stratofortress\" title=\"Boeing B-52 Stratofortress\">B-52<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D0%B8%D0%B0%D0%BA%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%BD%D0%B0%D0%B4_%D0%9F%D0%B0%D0%BB%D0%BE%D0%BC%D0%B0%D1%80%D0%B5%D1%81%D0%BE%D0%BC\" title=\"\u0410\u0432\u0438\u0430\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u043d\u0430\u0434 \u041f\u0430\u043b\u043e\u043c\u0430\u0440\u0435\u0441\u043e\u043c\">\u0441\u0442\u043e\u043b\u043a\u043d\u0443\u043b\u0441\u044f \u043d\u0430\u0434 \u0418\u0441\u043f\u0430\u043d\u0438\u0435\u0439<\/a> \u0441 \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u043e\u043c-\u0437\u0430\u043f\u0440\u0430\u0432\u0449\u0438\u043a\u043e\u043c. \u0412 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u044b \u0441\u0435\u043c\u044c \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043f\u043e\u0433\u0438\u0431\u043b\u0438, \u043e\u0434\u043d\u0430 \u0438\u0437 \u0442\u0435\u0440\u043c\u043e\u044f\u0434\u0435\u0440\u043d\u044b\u0445 \u0431\u043e\u043c\u0431, \u043d\u0430\u0445\u043e\u0434\u0438\u0432\u0448\u0438\u0445\u0441\u044f \u043d\u0430 \u0431\u043e\u0440\u0442\u0443 B-52, \u0443\u043f\u0430\u043b\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%80%D0%B5%D0%B4%D0%B8%D0%B7%D0%B5%D0%BC%D0%BD%D0%BE%D0%B5_%D0%BC%D0%BE%D1%80%D0%B5\" title=\"\u0421\u0440\u0435\u0434\u0438\u0437\u0435\u043c\u043d\u043e\u0435 \u043c\u043e\u0440\u0435\">\u0421\u0440\u0435\u0434\u0438\u0437\u0435\u043c\u043d\u043e\u0435 \u043c\u043e\u0440\u0435<\/a> \u0438 \u0431\u044b\u043b\u0430 \u043d\u0430\u0439\u0434\u0435\u043d\u0430 \u043b\u0438\u0448\u044c \u0447\u0435\u0440\u0435\u0437 \u0434\u0432\u0430 \u043c\u0435\u0441\u044f\u0446\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1991_%D0%B3%D0%BE%D0%B4\" title=\"1991 \u0433\u043e\u0434\">1991<\/a>&#160;\u2014 \u043c\u043d\u043e\u0433\u043e\u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0435 \u0441\u0438\u043b\u044b, \u0434\u0438\u0441\u043b\u043e\u0446\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0435 \u0432 \u0437\u043e\u043d\u0435 \u041f\u0435\u0440\u0441\u0438\u0434\u0441\u043a\u043e\u0433\u043e \u0437\u0430\u043b\u0438\u0432\u0430, \u043d\u0430\u0447\u0430\u043b\u0438 \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044e \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D1%80%D1%8F_%D0%B2_%D0%BF%D1%83%D1%81%D1%82%D1%8B%D0%BD%D0%B5\" class=\"mw-redirect\" title=\"\u0411\u0443\u0440\u044f \u0432 \u043f\u0443\u0441\u0442\u044b\u043d\u0435\">\u0411\u0443\u0440\u044f \u0432 \u043f\u0443\u0441\u0442\u044b\u043d\u0435<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1995_%D0%B3%D0%BE%D0%B4\" title=\"1995 \u0433\u043e\u0434\">1995<\/a>&#160;\u2014 \u0431\u043e\u043b\u0435\u0435 6400 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043f\u043e\u0433\u0438\u0431\u043b\u0438 \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u043c\u043e\u0449\u043d\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B5%D0%BC%D0%BB%D0%B5%D1%82%D1%80%D1%8F%D1%81%D0%B5%D0%BD%D0%B8%D0%B5_%D0%B2_%D0%9A%D0%BE%D0%B1%D0%B5\" title=\"\u0417\u0435\u043c\u043b\u0435\u0442\u0440\u044f\u0441\u0435\u043d\u0438\u0435 \u0432 \u041a\u043e\u0431\u0435\">\u0437\u0435\u043c\u043b\u0435\u0442\u0440\u044f\u0441\u0435\u043d\u0438\u044f<\/a>, \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u0435\u0434\u0448\u0435\u0433\u043e \u0432 \u044f\u043f\u043e\u043d\u0441\u043a\u043e\u043c \u0433\u043e\u0440\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%B1%D0%B5\" title=\"\u041a\u043e\u0431\u0435\">\u041a\u043e\u0431\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2001_%D0%B3%D0%BE%D0%B4\" title=\"2001 \u0433\u043e\u0434\">2001<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B2%D1%80%D0%B5%D0%B8\" title=\"\u0415\u0432\u0440\u0435\u0438\">\u0435\u0432\u0440\u0435\u0438<\/a>, \u043f\u0435\u0440\u0435\u0436\u0438\u0432\u0448\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%BE%D0%BB%D0%BE%D0%BA%D0%BE%D1%81%D1%82\" title=\"\u0425\u043e\u043b\u043e\u043a\u043e\u0441\u0442\">\u0425\u043e\u043b\u043e\u043a\u043e\u0441\u0442<\/a>, \u0434\u043e\u0431\u0438\u043b\u0438\u0441\u044c \u043a\u043e\u043c\u043f\u0435\u043d\u0441\u0430\u0446\u0438\u0438 \u043e\u0442 \u0432\u043b\u0430\u0441\u0442\u0435\u0439 \u0410\u0432\u0441\u0442\u0440\u0438\u0438 \u0437\u0430 \u0438\u043c\u0443\u0449\u0435\u0441\u0442\u0432\u043e, \u043a\u043e\u043d\u0444\u0438\u0441\u043a\u043e\u0432\u0430\u043d\u043d\u043e\u0435 \u0432 \u043f\u0435\u0440\u0438\u043e\u0434 \u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u044f \u043d\u0430\u0446\u0438\u0441\u0442\u043e\u0432.<\/li><\/ul><h2>"}